export default function CartWidget() {

    const count = useContext(Contexto).count
    console.log(count)

    return (
        <li>
            <NavLink>
                <img src={imagenCarrito} alt="imgCarrito"/>
                <p className="m-0">Cart</p>
                <span>{count.length}</span>
            </NavLink>
        </li>
    )
}
